import React from "react";
import ReactDOM from "react-dom/client";

const root = ReactDOM.createRoot(document.getElementById("root"));

function Card() {
  return (
    <>
      <h1>Sushant Dahal</h1>
      <img src="https://images.pexels.com/photos/3473516/pexels-photo-3473516.jpeg?cs=srgb&dl=pexels-elijah-o%27donnell-3473516.jpg&fm=jpg" />
    </>
  );
}

root.render(
  <>
    <Card />
  </>
);
